import styled from 'styled-components'

export const TitleText = styled.div`
  display: flex;
  align-items: center;
  justify-content: center;
  font-weight: bolder;
  font-size: 67px;
  margin: 2rem 2rem;

  @media screen and (min-width: 650px) {
    font-size: 10vw;
  }
`
